// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.26;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public Tokens;

    struct DummyMan{
        uint256 age;
        uint256 health;
        bool initialized;
    }

    mapping(uint256 => DummyMan) idToMan;

    event tokenCreated(uint256 tokenId);

    function getAge(uint256 _tokenId) public view returns(uint256){
        return idToMan[_tokenId].age;
    }

    function createToken(uint256 _age , uint256 _health) public {
        idToMan[Tokens] = DummyMan(_age , _health , true);
        Tokens++;
        emit tokenCreated(Tokens);
    }
}

